import React from 'react';
import './MainHeader.css';

class MainHeader extends React.Component {

  // boilerplate code
  constructor(props) {
    super(props);
  }

  // what to do with drawing
  render() {
    return (
      <div class="mainheader">
        <h1>Jen Goldberg</h1>
        <div class="pageselections">
          <div class="column">
            UXR
          </div>
          <div class="column">
            Graphic Design
          </div>
          <div class="column">
            Me
          </div>
        </div>
      </div>
    );
  }
}

export default MainHeader;
